import React from 'react'
import axios from 'axios'
import { FormGroup, Form, Button, Input } from 'reactstrap';
import {connect} from 'react-redux';
import {getDOWRequest} from '../actions/dow'

axios.defaults.baseURL = 'https://www.quandl.com/api/v3/datasets'

class App extends React.Component {

  handleSubmit = () => {
    // console.log('handleSubmit')
    this.props.getDOWRequest();
    this.useStat
  }

  render(){
      const data = this.props;
      console.log(data);
    return (
      <div className="App">
        <div>
        <Form inline>
              <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
                <Input onChange = {this.handleChange} type="date" name="Date" placeholder="YYYY-MM-DD" />
              </FormGroup>
              <Button onClick = {this.handleSubmit}>Submit</Button>
        </Form>
        </div>
      </div>
    );
  }
}

export default connect(({data}) => ({data}),{
  getDOWRequest
})(App);
